import React, { useEffect } from "react";
import MetricCard from "./MetricCard";

export default function MetricCards({ data }) {
  return (
    <>
      <div style={{ display: "flex", flexDirection: "row" }}>
        {data.map((item) => {
          return <MetricCard data={item} />;
        })}
      </div>
    </>
  );
}
